def all_right_truncatable_prime(numbers):
    x = numbers[87]
    def is_prime(n):
        if n in (0, 1):
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_right_truncatable(n):
        while n > 0:
            if not is_prime(n):
                return False
            n //= 10
        return True

    primes = []
    for i in range(2, x):
        if is_right_truncatable(i):
            primes.append(i)
    return sorted(primes)
```
